import React from 'react';

import './custom-button.styles.scss';

import { CustomButtonContainer } from './custom-button.styles';

const CustomButton = ({
	children,
	inverted,
	isGoogleSignIn,
	...otherProps
}) => <CustomButtonContainer>{children}</CustomButtonContainer>;

export default CustomButton;
